import './App.css';
import Person from './Components/Person/Person';




class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>
          Hello world !
      </h1>
        <p>This is really working dude! </p>
        <Person name="Daegil" age='28' />
        <Person name="Hazel" age='22' >Hello </Person>
        <Person name="Emi" age='34' />
      </div>
    );
